import React from 'react';

const Category = (props) => {

    const {category} = props;

    return (

        <div className="product-card">
          <div className="product-image">
            <img src={category.strCategoryThumb} />
          </div>
          <div>
            <h3>{category.strCategory}</h3>
          </div>
        </div>
      );


};
export default Category;
